import React  from "react";

function One(){ 
   return(
    <div style={{position:"absolute",top:"calc(50% - 7.5px)",left:"calc(50% - 7.5px)"}} 
        className="point-dadosa bg-dark rounded-circle">
    </div>
    )
}
function Two(){
    return(
        <>
            <div style={{position:"absolute",top:"calc(50% - 7.5px)",left:"calc(30% - 7.5px)"}} 
                className="point-dadosa bg-dark rounded-circle">
                </div>    
                <div style={{position:"absolute",top:"calc(50% - 7.5px)",right:"calc(30% - 7.5px)"}} 
                    className="point-dadosa bg-dark rounded-circle">
            </div>
        </>
    )
}
function Three(){
    return(
        <>
        <div style={{position:"absolute",top:"calc(30% - 7.5px)",left:"calc(50% - 7.5px)"}} 
            className="point-dadosa bg-dark rounded-circle"
        ></div>    
        <div style={{position:"absolute",bottom:"calc(30% - 7.5px)",left:"calc(30% - 7.5px)"}} 
            className="point-dadosa bg-dark rounded-circle"
        ></div>    
        <div style={{position:"absolute",bottom:"calc(30% - 7.5px)",right:"calc(30% - 7.5px)"}} 
            className="point-dadosa bg-dark rounded-circle">
        </div>
        </>
    )
}
function Four(){
    return(
    <>
    <div style={{position:"absolute",top:"calc(30% - 7px)",   left:"calc(30% - 7px)"}}
        className="point-dadosa bg-dark rounded-circle"></div>  
    <div style={{position:"absolute",top:"calc(30% - 7px)",   right:"calc(30% - 7px)"}}
        lassName="point-dadosa bg-dark rounded-circle"></div>    
    <div style={{position:"absolute",bottom:"calc(30% - 7px)",left:"calc(30% - 7px)"}}
        className="point-dadosa bg-dark rounded-circle"></div>    
    <div style={{position:"absolute",bottom:"calc(30% - 7px)",right:"calc(30% - 7px)"}}
        lassName="point-dadosa bg-dark rounded-circle"></div>
    </>
    )
}
function Five(){
    return(
        <>
        <div style={{position:"absolute",top:"calc(30% - 4px)",left:"calc(30% - 4px)"}} 
            className="point-dadosa bg-dark rounded-circle"
        ></div>
        <div style={{position:"absolute",top:"calc(30% - 4px)",right:"calc(30% - 4px)"}} 
            className="point-dadosa bg-dark rounded-circle"
        ></div>
        <div style={{position:"absolute",bottom:"calc(30% - 4px)",left:"calc(30% - 4px)"}} 
            className="point-dadosa bg-dark rounded-circle"
        ></div>    
        <div style={{position:"absolute",bottom:"calc(30% - 4px)",right:"calc(30% - 4px)"}} 
            className="point-dadosa bg-dark rounded-circle"
        ></div>    
        <div style={{position:"absolute",top:"calc(50% - 7.5px)",left:"calc(50% - 7.5px)"}} 
            className="point-dadosa bg-dark rounded-circle"
        ></div>   
        </>
    )
}
function Six(){
    return(
        <>
        <div style={{position:"absolute",top:"calc(20% - 4px)",left:"calc(30% - 4px)"}}
             className="point-dadosa bg-dark rounded-circle"></div>
        <div style={{position:"absolute",top:"calc(20% - 4px)",right:"calc(30% - 4px)"}}
             className="point-dadosa bg-dark rounded-circle"></div>    
        <div style={{position:"absolute",bottom:"calc(20% - 4px)",left:"calc(30% - 4px)"}}
             className="point-dadosa bg-dark rounded-circle"></div>    
        <div style={{position:"absolute",bottom:"calc(20% - 4px)",right:"calc(30% - 4px)"}}
             className="point-dadosa bg-dark rounded-circle"></div>    
        <div style={{position:"absolute",top:"calc(50% - 7.5px)",left:"calc(30% - 4px)"}} 
            className="point-dadosa bg-dark rounded-circle"></div>    
        <div style={{position:"absolute",top:"calc(50% - 7.5px)",right:"calc(30% - 4px)"}} 
            className="point-dadosa bg-dark rounded-circle"></div>
        </>
    )
}



function Player(props){
    console.log(`Dadosa = ${props.bg}`);
    let poT , poL;
    if(props.bg === "var(--primary)"){ poT="0%"; poL="0%";}
    else if(props.bg === "var(--danger)"){ poT="calc(100vh - 150px)"; poL="0px";}
    else if(props.bg === "var(--success)"){poT="calc(100vh - 150px)";poL="calc(100% - 150px)";}
    else if(props.bg === "var(--warning)"){ poT="0%"; poL="calc(100% - 150px)"; }  

    switch (props.num){
        case 1 :  num = <One />
        case 2 :  num = <Two />
        case 3 :  num = <Three />
        case 4 :  num = <Four />
        case 5 :  num = <Five />
        case 6 :  num = <Six />
    }
    
    return(
        <div className="Player_cadre bg-light position-absolute rounded border border-5 d-flex justify-content-center align-items-center"
        style={{top:poT, left:poL}}>
            <div className="Player_dadosa border rounded" style={{backgroundColor:props.bg}}>
                {num}
            </div>
        </div>
    )
}

export default React.memo(Player);
